  <script>
    // ************************ Drag and drop ***************** //
    let dropArea = document.getElementById("drop-area")

    // Prevent default drag behaviors
    ;['dragenter', 'dragover', 'dragleave', 'drop'].forEach(eventName => {
      dropArea.addEventListener(eventName, preventDefaults, false)   
      document.body.addEventListener(eventName, preventDefaults, false)
    })

    // Highlight drop area when item is dragged over it
    ;['dragenter', 'dragover'].forEach(eventName => {
      dropArea.addEventListener(eventName, highlight, false)
    })

    ;['dragleave', 'drop'].forEach(eventName => {
      dropArea.addEventListener(eventName, unhighlight, false)
    })

    // Handle dropped files
    dropArea.addEventListener('drop', handleDrop, false)

    function preventDefaults (e) {
      e.preventDefault()
      e.stopPropagation()
    }

    function highlight(e) {
      dropArea.classList.add('highlight')
    }

    function unhighlight(e) {
      dropArea.classList.remove('active')
    }

    function handleDrop(e) {
      var dt = e.dataTransfer
      var files = dt.files

      handleFiles(files)
    }

    let uploadProgress = []
    let progressBar = document.getElementById('progress-bar')

    function initializeProgress(numFiles) {
      progressBar.value = 0
      uploadProgress = []

      for(let i = numFiles; i > 0; i--) {
        uploadProgress.push(0)
      }
    }

    function updateProgress(fileNumber, percent) {
      uploadProgress[fileNumber] = percent
      let total = uploadProgress.reduce((tot, curr) => tot + curr, 0) / uploadProgress.length
      progressBar.value = total
    }

    function handleFiles(files) {
      files = [...files]
      initializeProgress(files.length)
      files.forEach(uploadFile)
      files.forEach(previewFile)
    }

    function previewFile(file) {
      let reader = new FileReader()
      reader.readAsDataURL(file)
      reader.onloadend = function() {
        let img = document.createElement('img')
        img.src = reader.result
        document.getElementById('gallery').appendChild(img)
      }
    }

    function uploadFile(file, i) {
      var turl = url + "/cardocr"
      var xhr = new XMLHttpRequest()
      var formData = new FormData()
      xhr.open('POST', turl, true)
    
      // Update progress (can be used to show progress indicator)
      xhr.upload.addEventListener("progress", function(e) {
        updateProgress(i, (e.loaded * 100.0 / e.total) || 100)
      })
    
      xhr.addEventListener('readystatechange', function(e) {
        if (xhr.readyState == 4 && xhr.status == 200) {
          updateProgress(i, 100) // <- Add this
          ocrdata = JSON.parse(xhr.responseText.replace(/\\/gi,''))['result'];
          console.log(ocrdata)

          var startX = 0;
          var startY = 0;
          var gofind = false;
          var carddeck = [];
          var carddeckline = 0;
          var notfindcard= [];
          var detailcarddeck = {};
          var lastX = -100;
          var cardcenterX = []
          var temp = [];    

          for (var i = 0; i < ocrdata.length; i++) {
            e = ocrdata[i];

            if(e.recognition_words == '카드 삭제'){
              // 1200
              startX = e.boxes[0][0] - 1100;
              // 98
              EndX = e.boxes[0][0] + 15;

              firstCardCenterX = startX + 58;
              for (var j = 0; j < 10; j++) {
                cardcenterX.push(firstCardCenterX + (j * 118))
              }
              tempcardcenterX = [...cardcenterX];

              // 239
              startY = e.boxes[0][1] + 91;
              // 290
              gofind = true;
            }
            
            if(gofind){
              x = e.boxes[0][0];
              yArr = [e.boxes[0][1],e.boxes[1][1],e.boxes[2][1],e.boxes[3][1]]
              Top = (startY + 10) + (182 * carddeckline);
              Bottom = Top + 21;
              highY = Math.min(...yArr);
              lowY = Math.max(...yArr);

              if(EndX >= x && x >= startX && highY >= Top && lowY <= Bottom){
                if(22 >= lastX - e.boxes[0][0] && lastX - e.boxes[0][0] >= -22 && e.boxes[0][0] < lastX + 22){continue;}
                for (var j = 0; j < tempcardcenterX.length; j++) {
                  if(tempcardcenterX[j] < e.boxes[1][0] && tempcardcenterX[j] < e.boxes[0][0]){
                    tempcardcenterX.splice(j,1);
                  }
                }
                temp.push({"x": e.boxes[0][0], "card": e.recognition_words[0]});
                lastX = e.boxes[1][0];  
                
                if(temp.length == 10){
                  temp.sort(function(a, b){
                    return a.x - b.x;
                  });
                  temp.forEach(function(t){
                    carddeck.push(t.card);
                  })
                  temp = [];
                  tempcardcenterX = [...cardcenterX];
                  carddeckline++;
                }

                if(carddeck.length == 40){
                  temp.forEach(function(card){
                    carddeck.push(card.replace(']','').substr(card.indexOf('[') + 1));
                  })
                  break;
                }
              }
            }
          }
          console.log(carddeck)

          let src = cv.imread('c');
          let dst = new cv.Mat();
          let rect = new cv.Rect(0,0,0,0);
          let low = new cv.Mat(src.rows, src.cols, src.type(), [0, 0, 0, 0]);
          let high = new cv.Mat(src.rows, src.cols, src.type(), [122, 122, 121, 255]);
          cv.inRange(src, low, high, dst);
          let inRangeDst = dst

          deckrow = carddeck.length / 10;
          for (var i = 0; i < deckrow; i++) {
            y = startY + (i * 182);
            for (var j = 0; j < 10; j++) {
              if(((i*10) + j) == carddeck.length){
                break;
              }
              x = startX + (j * 118);
              rect = new cv.Rect(x, y, 116, 164);
              dst = inRangeDst.roi(rect);

              cardname = carddeck[parseInt(String(i)+String(j))];
              if(cardlist.indexOf(cardname) == -1){
                notfindcard.push(cardname);
              }

              for (var k = 5; k > 0; k--) {
                if(dst.ucharAt(137, (92 - (Math.abs(k-5) * 15)) * dst.channels()) == 0){
                  detailcarddeck[carddeck[parseInt(String(i)+String(j))]] = k;
                  k=0;
                }else if(k==1){
                  detailcarddeck[carddeck[parseInt(String(i)+String(j))]] = 0;
                }
              }

              $('#canvaszone').append(`<canvas id="canvasOutput${(i*10) + j}"></canvas>`);
              cv.imshow(`canvasOutput${(i*10) + j}`, dst);
            }
          }
          
          low.delete();
          high.delete();
          src.delete();
          dst.delete();
        }
        else if (xhr.readyState == 4 && xhr.status != 200) {
          // Error. Inform the user
        }
      })
    
      formData.append('file', file)
      xhr.send(formData)
    }
